import Card from '../card/Card';
import style from './cards.module.css'
export default function Cards({characters, onClose}) {

   return (
   <div className={style.cards}>{
         characters.map(({onClose,id,name,species,gender,image,origin,status})=>{
               return (
                  <Card
                     key={id} 
                     id={id}
                     name={name} 
                     species={species} 
                     gender={gender} 
                     image={image} 
                     origin={origin.name} 
                     status={status}
                     onClose={onClose}
                  />
               )
            }
         )
      }</div>
   );
}
